import './App.css';
import { NavBar } from './Components/NavBar';
import { Banner } from './Components/Banner'
import { Skills } from './Components/Skills'
import 'bootstrap/dist/css/bootstrap.min.css';

import { progressCircleBar } from './Components/UI/progressCircleBar.js';


function App() {
  return (
    <div className="App">
      <NavBar />
      <Banner />
      <Skills />

      <div  style={{
      position: "absolute",
      width: "100%",
      height: "100%",
      backgroundColor: 'gray',
    }}>

    </div>
      <progressCircleBar />
      <progressCircleBar />
    </div>
  );
}

export default App;
